$(document).ready((function(){var searchInput=$("#usf-name");searchInput.autocomplete({minLength:1,source:searchInput.data("autocomplete-url")}),$("#usf-filters-link").on("click",(function(event){event.preventDefault();var filtersBox=$("#usf-filters-box");filtersBox.length&&(filtersBox.width($(this).closest("table").width()),filtersBox.is(":visible")?filtersBox.slideUp():filtersBox.slideDown())})),$(".usf-filter-snippet").on("click",(function(event){event.preventDefault();var snippet=$(this).find("code").text();searchInput.val(searchInput.val()+" "+snippet)}))}));